import { allHotDogsReducer } from './all-hot-dogs-reducer';

import { HOT_DOGS_KEY } from '../constants';

const reducers = {
  [HOT_DOGS_KEY]: allHotDogsReducer,
};

export const getReducers = () => ({ ...reducers });
